import React from "react";
// import logo from './studentcomputer.png'
import { Link } from "react-router-dom";
class Nav extends React.Component {
  render() {
    return (
      <div>
        <nav>
          {/* <img src={logo} alt="studentwithcomputer"/> */}
          <ul>
          <Link to="/d">
              <li key={"home"} className="navlink">Home</li>
            </Link>
            <Link to="/dashboard">
              <li key={"dashboard"} className="navlink">Student Dashboard</li>
            </Link>
            <Link to="/student">
              <li key={"student"} className="navlink">About me</li>
            </Link>
          </ul>
        </nav>
      </div>
    );
  }
}

export default Nav;
